  if (avatar) {
    return (
      <img
        src="https://www.google.com/url?sa=i&url=http%3A%2F%2Ffanaru.com%2Fthe-legend-of-zelda%2Fimage%2F27287%2Fcool-link-avatar%2F&psig=AOvVaw1dwSzo-jHKOug7Zz0C9kHy&ust=1579804104902000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCPCS-Ibrl-cCFQAAAAAdAAAAABAD"
        alt="asdf"
      />
    );
  } else {
    //make
  }
};

const DialogItem = ({ user, message }) => (
  <div className="dialogs_item">
    <div className="dialogs__item-avatar">
      {getAvatar}
      {/* <img src={user.avatar} alt={`${user.fullname} avatar`} /> */}
    </div>
    <div className="dialogs__item-info">
      <div className="dialogs__item-info-top">
        <b>Dostoevskiy Fedor</b>
        <Time date={new Date()} />
      </div>
      <div className="dialogs__item-ingo-bottom">
        <p>Real text for my massanjager</p>
        <IconReaded isMe={true} isReaded={false} />
      </div>
    </div>
  </div>
);

export default DialogItem;
